import React, { useEffect } from 'react';
import Header from './Header';
import Nav from './Nav';
import Footer from './Footer';
import styles from './Gallery.module.css'
import photos from '../data/gallery.json'

function Gallery() {
  useEffect((params) => {
    // const a = 1
    // console.log(document.getElementById(1).clientWidth)  
    // console.log(document.getElementById(1).clientHeight)  
  })

  return (
    <>
      <Header type='black'></Header>
      <Nav></Nav>
      <div className={`${styles.container} wow fadeInUp`} data-wow-duration='1s'>
        <div className={styles.title}>GALLERY</div>
        <div className={styles.galleryList}>
          {photos.map(i => 
          <img id={i.id} key={i.id} src={require("../img/gallery/"+i.imgUrl.split('/').slice(-2).join('/'))} alt="artist_photo"/>
            )}
        </div>
      </div>


      <Footer type='black-vertical'></Footer>
    </>
  );
}

export default Gallery;
